import "./App.css";
import Post from "./Post";
import Header from "./Header";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
    <Route path="/" element={<Layot/>}></Route>
      <Route
        index
        element={
        <Post/>
        }
      />
      <Route path={"/login"} element={
            <div>login page</div>} />
    </Routes>
  );
}

export default App;
